description:
Cleanskin (2012) XVID DD5.1 Custom NL Subs




Verenigd Koninkrijk
Thriller
108 minuten


geregisseerd door Hadi Hajaig
met Sean Bean, Abhin Galeya en Charlotte Rampling


Ewan is een ex-soldaat die nu werkzaam is bij MI5, de Britse geheime dienst. Daar heeft hij de taak om een zelfmoordterrorist en zijn handlangers op te sporen en te elimineren. De terrorist, Ash, is echter een zogenaamde &quot;cleanskin&quot;, wat inhoud dat deze bijna onmogelijk is op te sporen. Ondertussen worstelt Ash met zijn geweten.



Quality over Quantity (QoQ) releases Vertalingen.

Vertaling: WinchesterGirl &amp; pinkGaai

Controle: Smokey,bedankt QOQ !!!!





